import React from 'react'
import Item from '../Item/Item'
import { ProductsType } from '../../types/Types'
import Cart from '../Cart/Cart'
import { useItem } from './items.hook'
import Loading from '../Loading'
import { filterProductsData } from '../../helpers/helper'

const Items = () => {

  const { allData, loading } = useItem()
  const localData = filterProductsData(allData.data) 

  return (
    <>
      {loading ? <Loading />
        :
      <div>
        <Cart />
        {allData?.data.data.map((item: ProductsType) => <Item key={item.id} item={item} />)}
      </div>}
    </>
  )
}

export default Items
